import React, { Component } from 'react'
import { Link } from "react-router-dom";



class Footer extends Component {


    render() {
        return(
            <div className='footer-container'>

                <Link
                    to='/partner'
                    className='footer-link'
                >
                    Partner Business Portal
                </Link>


            </div>

        )
    }

}

export default Footer
